import React from 'react';
import Hero from '../ChildComponents/Hero'

function WelcomePage( props ){
  return(
    <div>
      <Hero title={ props.title } subTitle={ props.subTitle } subText></Hero>
    </div>
  )
}
export default WelcomePage
